import React, { useState } from 'react';
import classes from './Faq.module.css';
import HeaderNavigation from '../../UI/HeaderNavigation/HeaderNavigation';
import Footer from '../../Footer/Footer';
import FAQBlock from './FAQBlock/FAQBlock';
import questionIcon from '../../UI/icons/question-svgrepo-com.svg';
import shippingIcon from '../../UI/icons/shipping-fast-solid-svgrepo-com.svg';
import contactsIcon from '../../UI/icons/contact-us-svgrepo-com.svg';

const Faq = () => {
    const [shippingDetailsOpen, setShippingDetailsOpen] = useState(false);
    const [contactsDetailsOpen, setContactsDetailsOpen] = useState(false);
    const [faqDetailsOpen, setFaqDetailsOpen] = useState(false);
    
    const toggleShippingDetails = () => {
        setShippingDetailsOpen(!shippingDetailsOpen);
        setContactsDetailsOpen(false); 
        setFaqDetailsOpen(false);
    }

    const toggleContactsDetails = () => {
        setContactsDetailsOpen(!contactsDetailsOpen);
        setShippingDetailsOpen(false); 
        setFaqDetailsOpen(false);
    }

    const toggleFaqDetails = () => {
        setFaqDetailsOpen(!faqDetailsOpen);
        setShippingDetailsOpen(false); 
        setContactsDetailsOpen(false);
    }

    return (
        <div>
            <HeaderNavigation />
            <div className={classes.faq__wrapper}>
                <FAQBlock
                    icon={questionIcon}
                    title="Частые вопросы по заказам"
                    description="Предзаказы и их сроки, гарантии, отсутствие товара на сайте и другие вопросы."
                    onClick={toggleFaqDetails}
                />
                <li className={`${classes.shippingDetails} ${faqDetailsOpen ? classes.visible : ''}`}>
                    <p>Все ваши товары оригинал?</p>Да, у нас строго оригинальная продукция. Каждый товар проходит индивидуальную проверку.<br /><br />
                    <p>Какие у вас гарантии?</p>Более тысячи положительных отзывов с 2017 года в профиле <a href="https://vk.com/wall170701681_4583">вк</a> и  <a href="https://www.avito.ru/user/c560662529d1530f9fab8dd500a9934e/profile?src=sharing">авито</a>.<br /><br />
                    <p>Как быстро приходит товар по предзаказу?</p>Сроки доставки товаров по предзаказу составляют 14-21 день. Возможна экспресс доставка.<br /><br />
                    <p>Что делать, если желаемого товара нет на сайте?</p>Если интересующей позиции нет на сайте, она доступна по предзаказу. Обращайтесь по предзаказу к нашему <a href="https://t.me/NiceDunksManager">менеджеру</a>.<br /><br />
                </li>
                <FAQBlock
                    icon={shippingIcon}
                    title="Доставка и оплата"
                    onClick={toggleShippingDetails}
                    description="Варианты и сроки доставки, сроки отправки, способы оплаты, доставка в другие страны и другие вопросы."
                />
                <li className={`${classes.shippingDetails} ${shippingDetailsOpen ? classes.visible : ''}`}>
                    <br />Самовывоз в городе Москва в районе метро Ботанический Сад <br />
                    <br />Курьерская доставка по Москве осуществляется сервисами:
                    <br />Яндекс Go и Достависта <br />
                    <br />Доставка по России и СНГ осуществляется почтовыми службами: 
                    <br />Сдэк, Почта РФ и Boxberry  <br />
                    <br />Стоимость доставки рассчитывается отдельно <br />
                    <br />Доставка по миру осуществляется курьерской службой EMS Почта России<br />
                    <br />Стоимость доставки рассчитывается отдельно<br /><br />
                </li>
                <FAQBlock
                    icon={contactsIcon}
                    title="Наши контакты"
                    onClick={toggleContactsDetails}
                    description="Ссылки на наши социальные сети, перечень товаров под заказ и многое другое."
                />
                <li className={`${classes.shippingDetails} ${contactsDetailsOpen ? classes.visible : ''}`}>
                    <br/><a href="https://t.me/NiceDunksOrder">ПОЗИЦИИ ПОД ЗАКАЗ</a><br />
                    <br/><a href="https://www.instagram.com/_goba_/">личный аккаунт в инстаграме</a><br />
                    <br/><a href="https://vk.com/nicedunks">основная страница в вк</a><br />
                    <br/><a href="https://www.avito.ru/user/c560662529d1530f9fab8dd500a9934e/profile?src=sharing">мой профиль на авито</a><br />
                    <br/><a href="https://instagram.com/donalddunks/">аккаунт для продаж в инстаграмме</a><br />
                    <br/><a href="https://t.me/NiceDunksManager">менеджер по предзаказам</a><br /><br /><br />
                </li>
            </div>
            <Footer />
        </div>
    );
};

export default Faq;
